import * as React from 'react';
import {Map,Marker,Popup} from 'react-map-gl';
import {useState} from 'react';
import {Room,Star,StarHalfOutlined} from '@material-ui/icons';

function App() {
    const [viewState, setViewState] = useState({
        longitude: -100,
        latitude: 40,
        zoom: 2
      });
  return <Map
   {...viewState}
    style={{width: '100vw', height: '100vh'}}
    mapStyle="mapbox://styles/mapbox/streets-v9"
    onMove={evt => setViewState(evt.viewState)}
    onViewportChange={nextViewport=>{setViewState(nextViewport)}}
    mapboxAccessToken='pk.eyJ1IjoicmFqZ3VwdGE3NyIsImEiOiJjbDJxYjF6c2owYW43M2lwYmd2amwyemZvIn0.0IBA2qj2Q4RYrMhCLJu6Fw'
  >
       <Marker longitude={-100} latitude={40} anchor="bottom" >
      <Room style={{fontSize:viewState.zoom*10}}/>
        </Marker>

        <Popup longitude={-100} latitude={40}
        anchor="left">
        <div className='container'>
         <label>Title:</label>
         <h3 className='title'>Hello landmark</h3>
         <label>Description:</label>
         <p className='descrip'> new desc</p>
         <label>Rating:</label>
         <div className='stars'>
           <Star className='star'/>
           <Star className='star'/>
           <Star className='star'/>
           <Star className='star'/>
           <Star className='star'/>
         </div>

        </div>
         </Popup>)
   </Map>;
}
export default App;
